const h1 = {
	fontSize: '72pt',
	fontWeight: 'bold',
	textAlign: 'right',
	letterSpacing: '-8px',
	color: '#f0f0f0',
	margin:'-40px 0ps'
}

const p = {
	margin: '0px',
	xolor: '#666',
	fontSize:'16pt'
}

export default () => <div>
	<h1 style={h1}>Next.js</h1>
	<div style={p}>Welcome to next.js!</div>
	<hr />
	<div>
		<Link href="/other">
			<a>Go to Other page &gt;&gt;</a>
		</Link>
	</div>
</div>




